            <div key={this.props.i} className={`description w-max-{30%} flex flex-col`}>
                <h3 key={this.props.i} className="flex-row">{this.props.h3}</h3>
                <div key={this.props.i} className="flex-row">{this.props.l1}</div>
                <div key={this.props.i} className="flex-row">{this.props.l2}</div>
            </div>
        );
    }
}

export default Description;
